import React, { useState, useContext, useEffect } from "react"
import * as ReactDOM from "react-dom"
import Select from "react-select"
import Gun from "gun/gun"
import gql from "graphql-tag"
import graphqlGun from "graphql-gun"

import "fontsource-raleway/500.css"
import "fontsource-raleway/700.css"
import "fontsource-share-tech-mono"

import "./App.css"
import { GunContext, GunContextProvider } from "./contexts/Gun"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import { faArrowRight } from "@fortawesome/free-solid-svg-icons"

type StartNode = {
	value: string
	label: string
}

const App = () => {
	const [Starttext, setStarttext] = useState<string>("")
	const [Startnode, setStartnode] = useState<any>()
	const [Start, setStart] = useState<boolean>(false)
	const [Query, setQuery] = useState<string>(`{
 music {
  name
  bands[] {
   name
   genre
   albums[] {
    name
    songs[] {
     name
     lyrics
     type
    }
   }
  }
 }
}`)
	const [Result, setResult] = useState<string>("")
	// const [StartNodes, setStartNodes] = useState<Array<StartNode>>([])

	const updateQuery = (evt: any) => setQuery(evt?.target?.value || "")
	const updateStarttext = (evt: any) => {
		const value = evt?.target?.value || ""
		setStarttext(value)
		gun.get(value).once(node => {
			setStartnode(node)
		})
	}
	const selectStart = (evt:any) => {
		setQuery(`{
  ${Starttext} {
    ${Object.keys(Startnode)
      .filter((k) => k !== "_")
      .join("\n    ")}
  }
}`)
		setStart(true)
	}

	const { gun, Gun } = useContext(GunContext)

	const refreshQuery = () => {
		if (Query === "") return
		try {
			const querySingles = gql`
				${Query.replace(/\[\]/g, "(type: Set)")}
			`
			console.log(`querySingles`, querySingles)

			const getResults = async () => {
				console.log(`getting query results...`)
				const result = await graphqlGun(querySingles, gun)
				console.log(`result`, result)
				setResult(result)
			}
			getResults()
		} catch (gql_exception) {
			if (gql_exception.message.indexOf("Syntax Error: Unexpected Name") !== 0)
				console.log(`gql_exception`, gql_exception.message)
		}
	}
	
	useEffect(refreshQuery, [Query])

	return (
		<div className="App">
			{!Start && (
				<div className="wrapper start-wrapper">
					<div>
						<div className="labeled-input">
							<input
								type="text"
								name="startnode"
								value={Starttext}
								onInput={updateStarttext}
								// placeholder="node-id-1"
							/>
							<label htmlFor="startnode">Start node</label>
						</div>
						<button>
							<FontAwesomeIcon icon={faArrowRight} />
						</button>

						{!!Startnode && (
							<table className="start-results" onClick={selectStart}>
								<tbody>
									{Object.keys(Startnode)
										.filter((k) => k !== "_")
										.map((key) => (
											<tr key={key}>
												<th>{key}</th>
												<td>{JSON.stringify(Startnode[key])}</td>
											</tr>
										))}
								</tbody>
							</table>
						)}
					</div>
				</div>
			)}
			{Start && (
				<div className="wrapper app-wrapper">
					{/* <svg className="viz"></svg> */}
					<pre>{JSON.stringify(Result, null, "  ")}</pre>
					<div className="sidebar">
						{/* <input type="text" /> */}
						<button onClick={refreshQuery}>UPD</button>
						{/* <Select options={StartNodes} isMulti /> */}
						<textarea
							className="query"
							value={Query}
							onInput={updateQuery}
						></textarea>
					</div>
				</div>
			)}
		</div>
	)
}

ReactDOM.render(
	<GunContextProvider>
		<App />
	</GunContextProvider>,
	document.getElementById("root")
)
